NO CONTEST plea entered to count 5, resist officer.  Convicted.
The State moves to dismiss and read in counts 1 through 4.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for fifteen (15) months.
Conditions of probation:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) Defendant is to take all medications as prescribed;
3) No assaultive contact/behavior towards family members;
4) Complete forty (40) hours of community service;
5) Spend thirty (30) days in the county jail, under the Huber Law, stayed and to be imposed at the agents discretion;
6) pay court costs;
7) pay supervision fees in an amount to be determined by DOC.
Expungement is ordered under Section 973.015 upon successful completion of the sentence.  The Court finds that the defendant will benefit and society will not be harmed by expungment in this matter.
Plea Questionnaire and Waiver of Rights.
Notice of Right to Seek Postconviction Relief.
Minutes.
